import React from 'react';
import ProductItem from './ProductItem';
import Title from './Title';

class NewArrivals extends React.Component {
	constructor(props){
		super(props);
		this.productsList = [
			{ model: 'Reebok Track Jacket', price: '100$', image: '../assets/images/woman-trainjacket-red.jpg' },
			{ model: 'Reebok Track Jacket', price: '100$', image: '../assets/images/woman-trainjacket-red.jpg' },
			{ model: 'Reebok Track Jacket', price: '100$', image: '../assets/images/woman-trainjacket-red.jpg' },
			{ model: 'Reebok Track Jacket', price: '100$', image: '../assets/images/woman-trainjacket-red.jpg' }
		];
	}
	render(){
		return (
			<div>
				<Title />
				<div className="row">
					<div className="col-md-3">
						<ProductItem name="Reebok Track Jacket" price="100$"/>
					</div>
					<div className="col-md-3">
						<ProductItem name="Reebok Track Jacket" price="100$"/>
					</div>
					<div className="col-md-3">
						<ProductItem name="Reebok Track Jacket" price="100$"/>
					</div>
					<div className="col-md-3">
						<ProductItem name="Reebok Track Jacket" price="100$"/>
					</div>
				</div>
			</div>
		)
	}
}

export default NewArrivals;
